import { useEffect, useState } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import "../styles/register.css";
import BaseComponent from "../components/BaseComponent";
import DogItem from "../components/dogItem";

const Register = () => {
  const [dogs, setDogs] = useState(null);

  const fetchDogs = async () => {
    console.log("hello");
    const response = await axios.get(
      "https://api.jsonbin.io/b/6268780a019db467969220eb"
    );
    setDogs(response.data);
  };

  useEffect(() => {
    fetchDogs();
  }, []);

  // {
  //   "name":"Wille",
  //   "sex":"male",
  //   "breed":"rottweiler",
  //   "img":"https://images.dog.ceo/breeds/rottweiler/n02106550_10481.jpg",
  //   "present":true,
  //   "age":8,
  //   "chipNumber":"IOQ831684",
  //   "owner":{
  //   "name":"Ina",
  //   "lastName":"Robinson",
  //   "phoneNumber":"0705823141"
  //          }
  //       },

  return (
    <BaseComponent
      headerContent={
        <div>
          <h1 id="pageTitle">Hundregister</h1>
        </div>
      }
      mainContent={
        <div>
          {!dogs ? (
            <div>
              <p>Loading dogs...</p>
            </div>
          ) : (
            <div className="dogsMap">
              {dogs.map((dog) => {
                return (
                  <div className="dog">
                    <Link to={`/DogPage`} state={{data: dog}}style={{ textDecoration: "none" }}>
                      <DogItem dog={dog} />
                    </Link>
                  </div>
                );
              })}
            </div>
          )}
        </div>
      }
    />
  );
};

export default Register;
